import PopupWithForm from "./PopupWithForm";

const PopupConfirm = () => {
  return (
    <PopupWithForm name="confirm" title="Вы уверены?">
      <button className="popup__submit-button button popup__submit-button_place_popup-confirm" id="popupConfirmSubmitButton" type="submit"
        aria-label="Кнопка 'Создать'">Да</button>
    </PopupWithForm>
  )
}

export default PopupConfirm;
